/**
 * @module 1-liners/greaterOrEqual
 *
 * @description
 *
 * Same as `a >= b`.
 *
 * @example
 *
 * 	const greaterOrEqual = require('1-liners/greaterOrEqual');
 *
 * 	greaterOrEqual(2, 1); // => true
 * 	greaterOrEqual(2, 2); // => true
 * 	greaterOrEqual(1, 2); // => false
 *
 */
export default (x, y) => x >= y;
